import styled from 'styled-components'

const StyledAsideServers = styled.div`
  display: flex;
	width: 100%;
	padding: 0 22px 0 17px;
	flex-direction: column;
	margin-top: 17px;
	border-top: 1px solid var(--panelBorderGray);
`
export default StyledAsideServers
